import React from 'react';

const RealismIcon = () => {
  return (
    <svg width="50" height="50" viewBox="0 0 50 50" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
      <rect y="2" width="50" height="44.2997" fill="url(#pattern1)"/>
      <defs>
        <pattern id="pattern1" patternContentUnits="objectBoundingBox" width="1" height="1">
          <use xlinkHref="#image1" transform="scale(0.00325733 0.00367647)"/>
        </pattern>
        <image id="image1" width="307" height="272" xlinkHref="data:image/png;base64,"/>
      </defs>
    </svg>
  );
};

export default RealismIcon;
